import React from "react";

import Login from "../views/login";
import CadastroUsuario from "../views/cadastroUsuario"

import { Route, Routes, Redirect } from "react-router-dom";
import Home from "../views/home";
import CadastroConta from "../views/cadastroConta";
import CadastroCartao from "../views/cadastroCartao";
import ConsultaLancamentos from "../views/lancamentos/consultaLancamentos";
import CadastroLancamento from "../views/lancamentos/cadastroLancamento";
import CadastroCategoria from "../views/cadastroCategoria";
import CadastroLimiteDespesa from "../views/CadastroLimiteDespesa";

function Rotas() {
    return (
        <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/cadastro-usuario" element={<CadastroUsuario />} />

            <RotaAutenticada path="/" element={<Home />} />
            <RotaAutenticada path="/cadastro-conta" element={<CadastroConta />} />
            <RotaAutenticada path="/cadastro-cartao" element={<CadastroCartao />} />
            <RotaAutenticada path="/consulta-lancamentos" element={<ConsultaLancamentos />} />
            <RotaAutenticada path="/cadastro-lancamentos" element={<CadastroLancamento />} />
            <RotaAutenticada path="/cadastro-lancamentos/:id" element={<CadastroLancamento />} />
            <RotaAutenticada path="/cadastro-categoria" element={<CadastroCategoria />} />
            <RotaAutenticada path="/cadastro-limite-despesa" element={<CadastroLimiteDespesa />} />
        </Routes>
    );
}

function RotaAutenticada({component: Component, props}) {
    return (
        <Route {...props} render={(componentProps) => {
            if (usuarioAutenticado()) {
                return (
                    <Component {...componentProps} />
                )
            } else {

            }
        }} />
    );
}

const usuarioAutenticado = () => {
    return false
}

export default Rotas;
